(()=>{const e=document.querySelector(".invisible-box");e.style.gridTemplateColumns="repeat(50, 1fr)",e.style.gridTemplateRows="repeat(50, 1fr)";for(let t=0;t<Math.pow(50,2);t++){const t=document.createElement("div");t.classList.add("small-box");const l=Math.floor(1e3*Math.random());t.style.animationDelay=`${l}ms`,e.appendChild(t)}setTimeout((()=>{e.style.display="none"}),2e3)})();